PointsAwarded_Chart_1.query:
q = load "${App.Datasets.LoyaltyLedger_ManualActions7.FullyQualifiedName}";q = filter q by {{column(NQPCurrency_Name_1.selection, ["LoyaltyProgramCurrency_NQP_Currency"]).asEquality('LoyaltyProgramCurrency_NQP_Currency')}} or ('LoyaltyProgramCurrency_QP_Currency' is not null && 'LoyaltyProgramCurrency_QP_Currency' in all);
q = filter q by 'TransactionType' == "AdjustedPoints_Positive";
q = group q by ('ActivityDate_Year', 'ActivityDate_Month');
q = foreach q generate 'ActivityDate_Year' , 'ActivityDate_Month' , sum('Points') as 'sum_Points';

dummy = foreach q generate "1970" as 'Year', "01" as 'Month', "01" as 'Day';
dummy = group dummy by ('Year', 'Month', 'Day');
dummy = foreach dummy generate 'Year', 'Month', 'Day', 0 as 'Value';
dummy = fill dummy by (dateCols=('Year','Month','Day', "Y-M-D"));
dummy = timeseries dummy generate 'Value' as 'Value1' with (length = 30000, dateCols=('Year','Month','Day', "Y-M-D"));
dummy = group dummy by ('Year', 'Month', 'Day');
dummy = foreach dummy generate 'Year', 'Month', 'Day', 0 as 'Test';
dummy = filter dummy by {{row(ActivityDate_1.selection, [0], ["min", "max"]).asDateRange("date('Year','Month','Day')")}};

result = group dummy by ('Year', 'Month') full, q by ('ActivityDate_Year', 'ActivityDate_Month');
result = foreach result generate coalesce(dummy.'Year' + "~~~" + dummy.'Month', q.'ActivityDate_Year' + "~~~" + q.'ActivityDate_Month') as 'ActivityDate_Year~~~ActivityDate_Month', 
sum(q.'sum_Points') as 'AdjustedPoints_Positive';

